import { useState, useEffect } from 'react';
import axios from 'axios';
import { useContext } from 'react';
import { AuthContext } from '../App';

function AdminDashboard() {
  const { token } = useContext(AuthContext);
  const [users, setUsers] = useState([]);
  const [products, setProducts] = useState([]);
  const [error, setError] = useState(null);
  const [deleteId, setDeleteId] = useState(null); // Track item to delete
  const [isConfirming, setIsConfirming] = useState(false); // Control confirmation state

  useEffect(() => {
    const fetchData = async () => {
      if (!token) {
        setError('Please log in as admin');
        return;
      }
      try {
        const [usersRes] = await Promise.all([
          axios.get('http://localhost:5001/api/admin/users', { headers: { Authorization: `Bearer ${token}` } }),
          axios.get('http://localhost:5001/api/admin/products', { headers: { Authorization: `Bearer ${token}` } }),
        ]);
        setUsers(usersRes.data);
        setProducts(productsRes.data);
      } catch (err) {
        setError('Failed to fetch data');
        console.error('Admin dashboard fetch error:', err);
      }
    };
    fetchData();
  }, [token]);

  const handleDeleteUser = async (id) => {
    if (isConfirming) return; // Prevent multiple clicks
    setDeleteId(id);
    setIsConfirming(true);
    if (window.confirm('Are you sure you want to delete this user?')) { // Temporary confirm for now
      try {
        await axios.delete(`http://localhost:5001/api/admin/users/${id}`, { headers: { Authorization: `Bearer ${token}` } });
        setUsers(users.filter(user => user.id !== id));
        alert('User deleted successfully');
      } catch (err) {
        alert('Failed to delete user');
        console.error('Delete user error:', err);
      }
    }
    setIsConfirming(false);
    setDeleteId(null);
  };

  const handleDeleteProduct = async (id) => {
    if (isConfirming) return;
    setDeleteId(id);
    setIsConfirming(true);
    if (window.confirm('Are you sure you want to delete this product?')) {
      try {
        await axios.delete(`http://localhost:5001/api/admin/products/${id}`, { headers: { Authorization: `Bearer ${token}` } });
        setProducts(products.filter(product => product.id !== id));
        alert('Product deleted successfully');
      } catch (err) {
        alert('Failed to delete product');
        console.error('Delete product error:', err);
      }
    }
    setIsConfirming(false);
    setDeleteId(null);
  };

  if (error) return <div className="text-center text-red-500 text-lg mt-8">{error}</div>;

  return (
    <div className="py-8">
      <h2 className="text-3xl font-bold text-center text-blue-700 mb-6">Admin Dashboard</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 max-w-4xl mx-auto">
        {/* Users Section */}
        <div className="bg-white p-4 rounded-lg shadow-md">
          <h3 className="text-xl font-semibold text-blue-700 mb-4">Users</h3>
          {users.length > 0 ? (
            <ul>
              {users.map((user) => (
                <li key={user.id} className="flex justify-between items-center py-2 border-b">
                  <span>{user.email} {user.is_admin ? '(Admin)' : ''}</span>
                  <button
                    onClick={() => handleDeleteUser(user.id)}
                    className="btn btn-danger"
                    disabled={isConfirming && deleteId === user.id}
                  >
                    {isConfirming && deleteId === user.id ? 'Confirming...' : 'Delete'}
                  </button>
                </li>
              ))}
            </ul>
          ) : (
            <p className="text-gray-500">No users found.</p>
          )}
        </div>

        {/* Products Section */}
        <div className="bg-white p-4 rounded-lg shadow-md">
          <h3 className="text-xl font-semibold text-blue-700 mb-4">Products</h3>
          {products.length > 0 ? (
            <ul>
              {products.map((product) => (
                <li key={product.id} className="flex justify-between items-center py-2 border-b">
                  <span>{product.name} - ₹{product.price}</span>
                  <button
                    onClick={() => handleDeleteProduct(product.id)}
                    className="btn btn-danger"
                    disabled={isConfirming && deleteId === product.id}
                  >
                    {isConfirming && deleteId === product.id ? 'Confirming...' : 'Delete'}
                  </button>
                </li>
              ))}
            </ul>
          ) : (
            <p className="text-gray-500">No products found.</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
